h'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1139116","type":"CustomJS"},{"attributes":{"overlay":{"id":"1138957"}},"id":"1138952","type":"BoxZoomTool"},{"attributes":{"axis":{"id":"1138709"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1138712","type":"Grid"},{"attributes":{"label":{"value":"Max Dd Dur. (1777 days)"},"renderers":[{"id":"1138860"}]},"id":"1138882","type":"LegendItem"},{"attributes":{},"id":"1138940","type":"LinearScale"},{"attributes":{"source":{"id":"1138786"}},"id":"1138791","type":"CDSView"},{"attributes":{},"id":"1138801","type":"UnionRenderers"},{"attributes":{"border_line_color":"#333333","click_policy":"hide","coordinates":null,"group":null,"items":[{"id":"1138807"},{"id":"1138830"},{"id":"1138855"},{"id":"1138882"}],"label_text_font_size":"8pt","location":"top_left","margin":0,"padding":5,"spacing":0},"id":"1138806","type":"Legend"},{"attributes":{"line_color":"red","line_width":2,"x":{"field":"x"},"y":{"value":1.0041199356000001}},"id":"1138857","type":"Line"},{"attributes":{},"id":"1139152","type":"AllLabels"},{"attributes":{},"id":"1138889","type":"LinearScale"},{"attributes":{"line_alpha":0.2,"line_color":"red","line_width":2,"x":{"field":"x"},"y":{"value":1.0041199356000001}},"id":"1138859","type":"Line"},{"attributes":{"label":{"value":"Final (12%)"},"renderers":[{"id":"1138812"}]},"id":"1138830","type":"LegendItem"},{"attributes":{"active_drag":{"id":"1138713"},"active_scroll":{"id":"1138714"},"tools":[{"id":"1138713"},{"id":"1138714"},{"id":"1138715"},{"id":"1138716"},{"id":"1138717"},{"id":"1138718"},{"id":"1138719"},{"id":"1139114"},{"id":"1139117"}]},"id":"1138721","type":"Toolbar"},{"attributes":{"coordinates":null,"data_source
